							const {cart} = value;
							if(cart.length>0){
								return(
									<React.Fragment>
										<Title name="your" title="cart"/>
										<CartColumns/>
									</React.Fragment>
									)				
							}else{
								return 			
							}
							}
						}
					}	
				</ProductConsumer>
				<EmptyCart/>
			</section>)
	}
}

export default Cart;
